pragma solidity ^0.8.0;

contract Voting {
    address public admin;  // Admins Ethereum address
    struct Candidate {
        string name;
        uint voteCount;
    }
    Candidate[] public candidates;  // List of candidates
    mapping(address => bool) public voters;  // Registered voters
    mapping(address => bool) public hasVoted;  // Tracks who voted

    // Only admin can call these functions
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can do this!");
        _;
    }

    constructor() {
        admin = msg.sender;  // Set the deployer as admin
    }

    // Admin adds a candidate
    function addCandidate(string memory _name) public onlyAdmin {
        candidates.push(Candidate(_name, 0));
    }

    // Admin registers a voter
    function registerVoter(address _voter) public onlyAdmin {
        voters[_voter] = true;
    }

    // Citizen votes
    function vote(uint _candidateId) public {
        require(voters[msg.sender], "you have not registered!");
        require(!hasVoted[msg.sender], "you have already voted!");
        require(_candidateId < candidates.length, "Invalid candidate!");
        candidates[_candidateId].voteCount++;
        hasVoted[msg.sender] = true;
    }

    // Get total number of candidates
    function getCandidateCount() public view returns (uint) {
        return candidates.length;
    }

    // Get candidate details
    function getCandidate(uint _id) public view returns (string memory, uint) {
        require(_id < candidates.length, "Invalid candidate ID!");
        Candidate memory c = candidates[_id];
        return (c.name, c.voteCount);
    }
}
